package Operators;

public class RelationalOperaotrs {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=7, b=11;
		
		System.out.println("value of a "+a+" value of b "+b);
		System.out.println(a == b); //false
		System.out.println(a != b); //true
		System.out.println(a > b); //false
		System.out.println(a < b); //true
		System.out.println(a >= b); //false
		System.out.println(a <= b);  //true
		
	}

}
